import React, { Component } from "react";

class CardInfo extends Component {

  render() {
    return (
      <div className="col-xs-12 col-sm-12 col-md-12 col-lg-12" style={{ minHeight: "750px", marginTop: "15px" }}>
        <header style={{ backgroundColor: "#eb751d", minHeight: "30px" }}>
          <p style={{ color: '#fff', padding: "4px" }}>التفاصيل</p>
        </header>
        <div className="col-xs-12 col-sm-12 col-md-12 col-lg-12" style={{ height: "650px", backgroundColor: "#fff" }}>
        </div>
      </div>
    )
  }
}

export default CardInfo
